import './App.css';
import Header from './screens/templates/header'
//import LastPropertyForSales from './screens/components/lastPropertyForSales'

import React, { useEffect, useState } from 'react';

function App() {

  const properties = useState(0)
  const setProperties = useState([])

  useEffect(() => {
    fetch("http://localhost:8000/api/v1/properties")
    .then(res => res.json())
    .then(data => {
      setProperties(data.items)
    })
    .catch(error => console.log(error))
  }, [])

  return (
    <div className="App">
        <Header />
        <h1>Properties list</h1>
        {properties.map((p, index) =>
          <div key={index}>
            <h2>{p.propertyId}</h2>
          </div>
        )}
    </div>
  );

}

export default App;
